import Expenses from "./components/Expenses/Expenses";
import NewExpense from "./components/NewExpense/NewExpense";

function App() {
    const expenseItems = [
        {
            id: 1,
            title: 'Car Insurance',
            amount: 200.47,
            date: new Date(2020, 10, 12)
        },
        {
            id: 1,
            title: 'Car Insurance',
            amount: 200.47,
            date: new Date(2020, 10, 12)
        }
    ];

    return (
        <div>
            <h2>Let's get started!</h2>
            <NewExpense />
            <Expenses expenseItems={expenseItems} />
        </div>
    );
}

export default App;
